import { GET_CURRENT_USER, LOGOUT_CURRENT_USER } from './types';
export const getCurrentUser = (user) => (dispatch) => {
    dispatch({
        type: GET_CURRENT_USER,
        user,
    });
};
export const logoutCurrentUser = () => (dispatch) => {
    dispatch({
        type: LOGOUT_CURRENT_USER,
    });
};
